import React from "react";
import { useNavigate } from "react-router-dom";
const axios = require('axios').default;



function NavBar() {
    const navigate = useNavigate();

    function logOut() {
        // document.cookie = `isLoggedIn=false; scure`
        const URL = 'http://localhost:4000/users/logout'; // for Local
        axios.post(URL)
            .then((res) => {
                console.log(res.data);
                navigate("/login");
            });

    }

    return <div>
        <nav className="navbar">

            <span className="navbar-brand">Poolit <a href="/"><img src="photos/swimming-logo.ico" alt="Poolit Logo"></img></a></span>
            <div className="">
                <ul className="navbar-nav ml-auto">
                    <li className="nav-item">
                        <span className="ml-auto"><a href="/login">Login </a></span>
                        <span className="navbar-right "><a href="/register"> Register</a></span>
                        <form action="http://localhost:4000/users/logout" method="post">
                            <span className="navbar-right "><button type="submit" className="btn" >Logout</button></span>

                        </form>
                        {/* {document.cookie.split("=")[1] === "false" ? <span className="ml-auto"><a href="/login">Login </a></span> : ""}
                        {document.cookie.split("=")[1] === "false" ? <span className="navbar-right "><a href="/register"> Register</a></span> : ""}
                        {document.cookie.split("=")[1] === "true" ? <span className="navbar-right "><button type="submit" className="btn" onClick={logOut}>Logout</button></span> : ""} */}
                    </li>
                </ul>
            </div>

        </nav>
    </div>
}




export default NavBar;
